"ยินดีต้อนรับเข้าสู่nubia Transfer เพื่อให้บริการที่ดีขึ้น แอพพลิเคชั่นต้องการ สิทธิ์การอนุญาตดังต่อไปนี้ในระหว่างกระบวนการของการใช้งาน:
 1.เข้าถึงข้อความของคุณ รวมถึงการอ่าน/เขียนข้อความSMS/MMS;
 2.เข้าถึงข้อมูลที่ตั้งของคุณ รวมทั้งสถานที่ใกล้เคียงและสถานที่แม่นยำ;
 3.ได้รับสิทธิ์การอนุญาตของการเข้าถึงเครือข่ายแบบเต็ม รวมถึงข้อมูลมือถือและเครือข่ายWi-Fi คุณจะถูกเรียกเก็บจากผู้ประกอบการของคุณ สำหรับข้อมูลการบริโภค กรุณาปรึกษาผู้ประกอบการของคุณสำหรับรายละเอียด;
 4.เชื่อมต่อและตัดการเชื่อมต่อเครือข่ายWi-Fi และส่งข้อมูลโดยทางWi-Fi;
 5.เข้าถึงกล้องของคุณ;
 6.เข้าถึงข้อมูลการสื่อสารของสังคม รวมถึงการอ่าน/เขียนหรือแก้ไขรายชื่อผู้ติดต่อของคุณและบันทึกการโทร;
 7.ใช้บลูทูธของคุณ:รวมถึงการจับคู่กับอุปกรณ์บลูทูธ การส่งข้อมูลโดยทางบลูทูธและการเข้าถึงการตั้งค่าบลูทูธ.

 โดยคลิก\"ตกลง\" แสดงว่าคุณเห็นด้วยกับเงื่อนไขข้างต้น"
